expected_sparql:
SELECT ?enzyme (COUNT(?protein) as ?size)
WHERE
{
    VALUES (?ecClass) {(ec:1.-.-.-) (ec:2.-.-.-) (ec:3.-.-.-) (ec:4.-.-.-) (ec:5.-.-.-) (ec:6.-.-.-) (ec:7.-.-.-) }
    ?protein up:enzyme ?enzyme .
    ?enzyme rdfs:subClassOf ?ecClass .
}
GROUP BY ?enzyme ORDER BY ?enzyme

initial_sparql:
SELECT ?ec (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
    ?protein a up:Protein ;
            up:enzyme ?enzyme .
    ?enzyme rdfs:subClassOf ?ec .
    # Match second level EC categories (e.g. 1.-.-.-) using regex
    FILTER(REGEX(STR(?ec), "^http://purl.uniprot.org/ec/[1-7]\\.-\\.-\\.-$"))
}
GROUP BY ?ec
ORDER BY ?ec

improved_sparql:
SELECT ?ec_readable (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
    ?protein a up:Protein ;
            up:enzyme ?enzyme .
    ?enzyme rdfs:subClassOf ?ec .
    BIND(REPLACE(STR(?ec), "http://purl.uniprot.org/ec/", "") AS ?ec_readable)
    FILTER(REGEX(?ec_readable, "^[1-7]\\.-\\.-\\.-$"))
}
GROUP BY ?ec_readable
ORDER BY DESC(?count)
